[' [CHÀO XUÂN ĐÓN CHUẨN ĐẦU RA  -  CÓ FLIC, NGẠI GÌ!?] 
 Việc chinh phục Chuẩn đầu ra CNTT sẽ trở nên thật đơn giản khi tham gia học & thi CNTT Cơ bản cùng FLIC. Đặc biệt, theo dòng sự kiện "Chào 2024 cùng FLIC", các mức ưu đãi cùng Combo vô cùng hấp dẫn đang chờ đợi các DUERs khám phá như: THI CNTT NÂNG CAO chỉ 495K, học CNTT Nâng cao nhóm 3 chỉ 400k/học viên,...
 Lệ phí thi CNTT Nâng cao (áp dụng đến trước 6/3/2024) chỉ với 495K;
