[' [CHÀO 2024 CÙNG FLIC - THI CNTT NÂNG CAO CHỈ VỚI 495K] 
 Để chào đón một năm 2024 với nhiều đổi mới, FLIC đã dành tặng các DUERs những chương trình ưu đãi hết sức đặc biệt, cụ thể là 
 LỆ PHÍ THI CNTT NÂNG CAO nay chỉ còn 495K 
 (giảm 255k so với mức phí gốc 750k) cùng các mức ĐĂNG KÝ NHÓM 3 giảm đến 400K nhưng đều có SLOT GIỚI HẠN 
 Đăng ký trước 06/03/2024 để nhận đặt lịch thi CNTT Nâng cao cùng FLIC nhé 
 ĐĂNG KÝ CÁ NHÂN
+ GÓI TC1: Thi Cơ bản 300k;
+ GÓI HC1: Học Cơ bản chỉ còn 300k;
+ GÓI TN1: Thi Nâng cao chỉ còn 495k;
+ GÓI HN1: Học Nâng cao chỉ còn 680k;
 ƯU ĐÃI CỰC NHIỀU KHI ĐĂNG KÝ NHÓM 
 ĐĂNG KÝ HỌC NÂNG CAO THEO NHÓM
+ GÓI HN3: Học Nâng cao (Nhóm 3SV): 750k/1hv, chỉ còn 400k;
 COMBO THI CƠ BẢN + HỌC NÂNG CAO
+ GÓI TH1: Thi Cơ bản + Học Nâng cao (Cá nhân): 1.050k/1hv, chỉ còn 800k;
+ GÓI TH3 Thi Cơ bản + Học Nâng cao (Nhóm 3SV): 1.050k/1hv, chỉ còn 650k;
 (Chương trình chỉ áp dụng cho SV đăng ký và giữ chỗ trước 06/03/2024) 
 SLOT CÓ HẠN, RỦ BẠN ĐĂNG KÝ NHẬN ƯU ĐÃI NGAY 
_________________________
 LỊCH THI CĐR TIN HỌC GẦN NHẤT:
- Kỳ thi 13-14/01/2024 (Hạn nộp: sáng 10/01/2024);
- Kỳ thi 27-28/01/2024 (Hạn nộp: sáng 24/01/2024);']
